export default function LeftNav({ data }) {
  return (
    <div className="row card-container">
      {data &&
        data.map((item, index) => (
          <div
            key={index}
            className="col-12 col-sm-8 col-md-6 col-lg-4 d-flex align-items-stretch my-2"
          >
            <div className="cards">
              <div className="card-image-container">
                <img
                  src={item?.links?.mission_patch_small}
                  alt={item.mission_name}
                />
              </div>
              <div className="card-body">
                <div className="card-title h5">Card Title</div>
                <ul>
                  <p className="mission-id card-text">
                    Missions Name: {item.mission_name}
                  </p>
                  <li>
                    <p className="mission-id card-text">
                      List Mission Ids: {item.mission_id}
                    </p>
                  </li>
                </ul>
                <p className="mission-id card-text">
                  Launch Year: {item.launch_year}
                </p>
                <p className="mission-id card-text">Successful Launch: </p>
                <p className="mission-id card-text">Successful Landing: </p>
              </div>
            </div>
          </div>
        ))}
    </div>
  )
}
